import { useCallback } from 'react';
import AppLayout from "../components/AppLayout";
import Head from 'next/head';
import { Form, Input } from "antd";

const Signup = () => {

    const onSubmit = useCallback(() => {

    }, []);

    return (
        <AppLayout>
            <Head>
                <title>NodeBird - 회원가입</title>
            </Head>
            <Form onFinish={onSubmit}>
                <div>
                    <label htmlFor="user-id">아이디</label>
                    <br />
                    <Input name='user-id' value={id} onChange={onChangeId} />
                </div>
                <div>
                    <label htmlFor="user-nick">닉네임</label>
                    <br />
                    <Input name='user-nick' value={nickname} onChange={onChangeNickname} />
                </div>
                <div>
                    <label htmlFor="user-password">비밀번호</label>
                    <br />
                    <Input name='user-password' type="password" value={password} onChange={onChangePassword} />
                </div>
                <div>
                    <label htmlFor="user-password-check">비밀번호체크</label>
                    <br />
                    <Input name='user-password-chekc' type="password" value={password} onChange={onChangePassword} />
                    
                </div>
            </Form>
        </AppLayout>
    )
};
export default Signup;
